     function find_distaince(){
     for(let i = 0; i < LenthOfR3; i++){  // this for loop for each row(which has a lot of node of cordinates) that represents a single road
       var LenthOfRoad=roads3.features[i].geometry.coordinates.length; // for finding the number of nods(cordinates) that each road has 
       for(let y = 0; y < LenthOfRoad-1; y++){

       var startLat1=roads3.features[i].geometry.coordinates[y][0];   // first cordinate
       var endLon1=roads3.features[i].geometry.coordinates[y][1];
        
       var startLat2=roads3.features[i].geometry.coordinates[y+1][0];   // second cordinates
       var endLon2=roads3.features[i].geometry.coordinates[y+1][1];
 
        Long += getDistanceFromLatLonInKm(startLat1 , endLon1, startLat2, endLon2);
     }
     //console.log("The road of ("+ i + ")  has distaince in KM as:   "+Long );
     Long = 0;                            // we have to make it 0 to store another long of a road
     }
    }

     function getDistanceFromLatLonInKm(lat1,lon1,lat2,lon2) {  //for finding the Distance between two points                                         }}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}
      var R = 6371; // Radius of the earth in km
      var dLat = deg2rad(lat2-lat1);  // deg2rad below
      var dLon = deg2rad(lon2-lon1); 
      var a = 
        Math.sin(dLat/2) * Math.sin(dLat/2) +
        Math.cos(deg2rad(lat1)) * Math.cos(deg2rad(lat2)) * 
        Math.sin(dLon/2) * Math.sin(dLon/2)
        ; 
      var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a)); 
      var d = R * c; // Distance in km
      return d;
    }
    
    function deg2rad(deg) {
      return deg * (Math.PI/180)
    }



